import { userService } from "../utils/services";
export const userActions = {
  login,
  logout,
  register
};

function login(username, password) {
  return { type: "LOGIN_REQUEST", username };
}

function logout(username, password) {
  userService.logout();
  return { type: "LOGOUT" };
}

function register(username, password) {}
